import React from 'react';
import './StoryUserMeta.scss';
import { STORY_DATA } from './STORY_DATA';

function StoryUserMeta() {
  return (
    <>
      {STORY_DATA.map(() => {
        return (
          <div className="userMeta" key={STORY_DATA.key}>
            <div className="userImgBackground">
              <img
                src="/taeyoung/images/userImg5.jpg"
                alt="img"
                className="userImg"
              />
            </div>
            <div className="userName">{STORY_DATA.userName}</div>
          </div>
        );
      })}
    </>
  );
}

export default StoryUserMeta;
